// src/pages/SignUp.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function SignUp() {
  const navigate = useNavigate();
  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="w-full max-w-md p-6 bg-white rounded-lg shadow-md">
        <h2 className="text-2xl font-bold text-center text-gray-800">Sign Up Page</h2>
        <p className="mt-4 text-center">Form for new user registration will go here.</p>
        <button
          onClick={() => navigate('/signin')} // Navigate back to sign in
          className="w-full px-4 py-2 mt-6 text-gray-800 bg-gray-200 rounded-md hover:bg-gray-300"
        >
          Go Back to Sign In
        </button>
      </div>
    </div>
  );
}
